  styleUrls: ['./add-new-doctor.component.css']
})
export class AddNewDoctorComponent {
  id:any;
  constructor(private route:ActivatedRoute){
    console.log(this.route.snapshot.params);
    this.id=this.route.snapshot.params['id'];
  }
}
